s:0:"";s:8:"position";s:0:"";s:4:"text";s:377:"Здравствуйте ! Скажите пожалуйста мне назначили продувание труб . Мужа мобилизовали . Стоит мне сейчас продувать? Как мне быть . Если сейчас делать , потом еще раз продувать? Не вредит эта процедура здоровью? ";s:5:"files";s:0:"";s:4:"date";s:20:"14 ноября 2022";}s:6:"answer";a:8:{s:5:"title";s:10:"Ответ";s:4:"name";s:8:"МЦРМ";s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:8:"position";s:0:"";s:4:"text";s:453:"Добрый день. Манипуляции для восстановлением проходимости маточных труб  лучше делать при условии возможности планирования беременности в ближайшие 6 мес. после процедуры. Для большей эффективности рекомендуется лапароскопия, рассечение спаек. ";s:5:"files";s:0:"";s:4:"date";s:20:"14 ноября 2022";s:13:"specialist_id";s:0:"";}}}s:4:"path";s:18:"/patients/consult/";}}';
